    data: |
      SELECT ALL - COUNT ( * ) + + COUNT ( * ) AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - ( + col2 ) * col1 - 71 IN ( 55 );
  - name: tab2

outputs:
  - name: q10256.out
    data: |
      0
